import React from "react";

import { withStyles, makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import Button from '@material-ui/core/Button';
import Checkbox from '@material-ui/core/Checkbox';

const StyledTableCell = withStyles(() => ({
  head: {
    backgroundColor: '#3f51b5',
    color: 'white',
  },
  body: {
    fontSize: 14,
  },
}))(TableCell);

// 

const StyledTableRow = withStyles((theme) => ({
  root: {
    '&:nth-of-type(odd)': {
      backgroundColor: theme.palette.action.hover,
    },
  },
}))(TableRow);

// 

const useStyles = makeStyles({
  table: {
    minWidth: 700,
  },
});

export default function Kpi3(props) {
  const classes = useStyles();

  return (
    <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="customized table">
        <TableHead>
          <TableRow>
            <StyledTableCell>SiteOrderID</StyledTableCell>
            <StyledTableCell align="right">Site</StyledTableCell>
            <StyledTableCell align="right">DateOrdered</StyledTableCell>
            <StyledTableCell align="center">Status</StyledTableCell>

          </TableRow>
        </TableHead>
        <TableBody>
        <StyledTableRow key={index} id={row._id}>
            <StyledTableCell component="th" scope="row">
            {row.company}
            </StyledTableCell>
            <StyledTableCell align="right">{row.firstName}</StyledTableCell>
            <StyledTableCell align="right">{row.lastName}</StyledTableCell>
            <StyledTableCell align="center">{row.email}</StyledTableCell>
            <StyledTableCell align="center">{row.numberSent}</StyledTableCell>
        </StyledTableRow>
        </TableBody>
      </Table>
    </TableContainer>
  );
}
